import { Radio } from "../components/Radio/index";
import { SelectBox } from "../components/SelectBox/index";
import { Img } from "../components/Img/index";
import { Text } from "../components/Text/index";
import { Button } from "../components/Button/index";

// import "./style.css";

export default function RegimenDetails() {
  return (
    <>
      <div className="cycles">
        <h4>Cycles</h4>
        <div className="row">
          <input type="radio" />
          <span>Every</span>
        </div>
        <div className="row">
          <input type="radio" />
          <span>Day</span>
        </div>
        <button>Check</button>
      </div>
      <div className="mediacations">
        <h4>Mediactions</h4>
        <div className="premediaction">
          <h3>PreMediactions</h3>
        </div>
        <div className="premediaction">
          <h3>ChemoTherapy</h3>
        </div>
      </div>
      <div className="notes">
        <h4></h4>
      </div>
    </>
  );
}
